import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {

  const auth = localStorage.getItem("user");
  const logout = ()=>{
    localStorage.clear()
  }
  return (
    <div className='Navbar'>
      <ul className='nav-ul'>
        <li><Link className='link' to="/">Home</Link></li>
        <li><Link className='link' to="/add">Add Product</Link></li>
        <li><Link className='link' to="/update">Update Product</Link></li>
        <li><Link className='link' to="/profile">Profile</Link></li>
        <li>{ auth ? <Link className='link' onClick={logout} to="/signup">Logout</Link>: <Link className='link' to="/signup">Sign Up</Link>}</li>
      </ul>
    </div>
  );
};

export default Navbar;
